def swap(best_child2):
#     # print("best_child2", best_child2)
    new_best_child2 = best_child2
#     # print("best_child2 intital", new_best_child2)
    while True:
        randgroup = []
        for i in range(2):
            x = random.randint(0, len(new_best_child2) - 1)
            randgroup.append(x)
#         # print("randgroup", randgroup)
        if new_best_child2[randgroup[0]] == new_best_child2[randgroup[1]] or randgroup[0] == randgroup[1]:
            continue
        else:
#             # print("randgroup", randgroup)
            break
#     # print("randgroup", randgroup)
    ch = new_best_child2[randgroup[0]]
#     # print("ch", ch)
    ch1 = new_best_child2[randgroup[1]]
#     # print("ch1", ch1)
#     # print(randgroup[0])
#     # print(randgroup[1])
    new_best_child2.pop(randgroup[0])
    new_best_child2.insert(randgroup[0], ch1)
    new_best_child2.pop(randgroup[1])
    new_best_child2.insert(randgroup[1], ch)
#     # print(new_best_child2)
    return new_best_child2

